const cars = [
    {
      model: "Honda Civic",
      //The top colour refers to the first item in the array below:
      //i.e. hondaTopColour = "black"
      colour: ["black", "silver"],
      speed: {
        top: 140,
        zero: 8.5
      }
    },
    {
      model: "Tesla Model 3",
      colour: ["red", "white"],
      speed: {
        top: 150,
        zero: 3.2
      }
    }
  ];
export default cars;
